// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

import "./IERC721.sol";

contract Market {


    // public- anyone can call
    // private - only this contract
    // internal - only this contract and inheriting contracts
    // external - only external calls
    
    enum ListingStatus {
        Active,
        Sold,
        Cancelled
    }

    struct Listing {
        ListingStatus status;
        address seller;
        address token;
        uint tokenId;
        uint price;
    }

    event Listed (
        uint listingId,
        address seller,
        address token,
        uint tokenId,
        uint price
    );

    event Sale (
        uint listingId,
        address buyer,
        address token,
        uint tokenId,
        uint price
    );

    event Cancel (
        uint listingId,
        address seller
    );

    uint private _listingId = 0; 
    mapping(uint => Listing) private _listings;

    function listToken(address token, uint tokenId, uint price) public {
        
        IERC721(token).transferFrom(msg.sender, address(this), tokenId);

        Listing memory listing = Listing (
            ListingStatus.Active,
            msg.sender,
            token,
            tokenId,
            price
        );
        _listingId++;
        _listings[_listingId] = listing;

        emit Listed( 
            _listingId,
            msg.sender,
            token,
            tokenId,
            price * 1 ether
        );
    }


    // function can read and write
    // view - read-only
    // pure - no read no write

    function add(uint a, uint b) public pure returns (uint) {
        return a + b;
    }

    function getListing(uint listingId) public view returns (Listing memory) {
        return _listings[listingId];
    } 

    function buyToken(uint listingId) external payable {
        Listing storage listing = _listings[listingId];
        

        require(msg.sender != listing.seller, "Seller can not be buyer");
        require(listing.status == ListingStatus.Active, "Listing is not active");

        require(msg.value >= listing.price, "Insufficient payment");

        IERC721(listing.token).transferFrom(address(this), msg.sender, listing.tokenId);
        payable (listing.seller).transfer(listing.price);

        listing.status = ListingStatus.Sold;

        emit Sale (
            listingId,
            msg.sender,
            listing.token,
            listing.tokenId,
            listing.price
        );
    }

    function cancel(uint listingId) public {
        Listing storage listing = _listings[listingId];

        require(msg.sender == listing.seller, "Only seller can cancel listing");    
        require(listing.status == ListingStatus.Active, "Listing is not active");

        listing.status = ListingStatus.Cancelled;
        IERC721(listing.token).transferFrom(address(this), msg.sender, listing.tokenId);

        emit Cancel (
            listingId, listing.seller
        );
    }

}
